import React from "react";
import "./style.css";
import loginForm from "../loginForm";

function Nav() {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <a className="navbar-brand" href="/">
        TV Track
      </a>
      <loginForm />
    </nav>
  );
}

export default Nav;
